    true,nt"url": null,nt"notes": "All political contributions of $100 or more
    made or delivered by the lobbyist or the lobbyist's employer, or made by a client
    at the behest of the lobbyist or the lobbyist's employer during the reporting period
    to an officer of the City and County, a candidate for such office, a committee controlled
    by such officer or candidate, or a committee primarily formed to support or oppose
    such officer or candidate, or any committee primarily formed to support or oppose
    a ballot measure to be voted on only in San Francisco. This includes political contributions
    arranged by the lobbyist, or for which the lobbyist acted as an agent or intermediary.Political
    contributions are disclosed by lobbyists registered with the Ethics Commission on
    a monthly basis.  This dataset updates automatically every night.",nt"license_title":
